import styled from 'styled-components/native';

export const Container = styled.View`
  background: #fff;
`;

export const DeliveryInfo = styled.View`
  margin: 20px 20px 10px 20px;
  border: 1px solid #0000001a;
  border-radius: 4px;
  background: #fff;
`;
export const Title = styled.View`
  padding-left: 15px;
  padding-top: 15px;
  display: flex;
  flex-direction: row;
  align-items: center;
`;
export const TitleText = styled.Text`
  padding-left: 5px;
  font-size: 14px;
  color: #7d40e7;
  font-weight: bold;
`;
export const Label = styled.Text`
  padding-left: 15px;
  padding-top: 5px;
  font-size: 14px;
  color: #999;
  line-height: 19px;
  font-weight: bold;
`;
export const LabelText = styled.Text`
  padding-left: 15px;
  padding-bottom: 10px;
  font-size: 14px;
  color: #666;
  line-height: 26px;
`;
export const DeliveryStatus = styled.View`
  margin: 0 20px 10px 20px;
  border: 1px solid #0000001a;
  border-radius: 4px;
  background: #fff;
`;
export const DateInfo = styled.View`
  display: flex;
  flex-direction: row;
`;
